import "./APILogIn.css";

function APILogIn() {
  //const API_KEY = null;
  function handleAuthenticate (event) {
    const API_KEY = event.target.value;
  }

  return (
    <form>
      <div className="api-log-in">
        <label>FTX API KEY</label>
        <input type="text" />
      </div>
      <button onClick={handleAuthenticate}> Authenticate </button>
    </form>
  );
}

export default APILogIn;
